import React, { useState, useEffect } from 'react'
import { View, StyleSheet, FlatList } from 'react-native'
import { Text, Card, Button, Icon } from 'react-native-elements';
import _Circular from '../../components/general/_Circular';

const Data = () => {
    return (
        <View>
            <_Circular />
        </View>
    )
}

export default Data;
